import { BrowserRouter, Route, Routes, } from 'react-router-dom';
import Auth from './components/auth/Auth';
import Home from './components/Home/Home';

function App() {
  return (
    <div>
      <BrowserRouter>

          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/auth' element={<Auth />} />

          </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
